import React from 'react';
import { Layout as AntLayout } from 'antd'
import Header from './Header';

const Layout = props => {
    return (
        <AntLayout className="site-layout" style={{ alignItems: 'center', height: '100vh', overflow:'auto' }}>
            {props.children}
        </AntLayout>
    );
}

export default Layout;
